### YamlMime:QSharpType
uid: microsoft.quantum.logical.notequall
name: NotEqualL
type: function
namespace: Microsoft.Quantum.Logical
summary: Retorna true se e somente se duas entradas não forem iguais.
remarks: >-
  Os itens a seguir são equivalentes:


  ```Q#

  let cond = a != b;

  let cond = NotEqualL(a, b);

  ```
syntax: 'function NotEqualL (a : BigInt, b : BigInt) : Bool'
input:
  content: '(a : BigInt, b : BigInt)'
  types:
  - name: a
    summary: O primeiro valor a ser comparado.
    isPrimitive: true
    uid: BigInt
  - name: b
    summary: O segundo valor a ser comparado.
    isPrimitive: true
    uid: BigInt
output:
  content: Bool
  types:
  - summary: '`true` se `a` não for igual a `b`.'
    isPrimitive: true
    uid: Bool
